import logo from './logo.svg';
import './App.css';
import { useState } from 'react';

function App() {
  let {setJudul, getJudul} =useState("Halo Dunia")

  const handleOnClick = (event) => {
    setJudul = "halo"
  }

  return (
    <div className="App">
      <h1>{getJudul}</h1>
      <button onClick={handleOnClick}>Ganti</button>
    </div>
  );
}

export default App;
